import React, { useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import CardMedia from '@material-ui/core/CardMedia';
import HomeUsersList from './UserList';
import NewUserButton from "../../components/NewUserButton/NewUserButton.jsx";
import SearchUserBar from "../../components/SearchUserBar/SearchUserBar.jsx"

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  usersWrapper: {
    paddingTop: '100px',
    width: '100%',
    maxWidth: '1400px',
    margin: '0 auto',
    paddingBottom: '250px',
  },
  header: {
    textAlign: 'center',
    fontSize: '35px',
    marginTop: '70px',
  },
}));

function Home() {
  const classes = useStyles();
  const [users, setUsers] = useState([1, 2, 3, 4, 5, 6, 7, 8]);
  return (
    <>
      <header className={classes.header}>Users</header>
      <div>
        <SearchUserBar />
        <NewUserButton />
      </div>
      <Grid
        src="https://images.unsplash.com/photo-1533090161767-e6ffed986c88?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60"
        className={classes.usersWrapper}
        container
        spacing={5}
        justify="center"
      >
        <HomeUsersList users={users} />
      </Grid>
    </>
  );
}

export default Home;
